CREATE TABLE imp_assets (
	imp_asset_id		serial primary key,
	client_id			integer,
	PC 					varchar(50),
	MONITOR				varchar(50),
	ITN					varchar(50),
	LPRT				varchar(50),
	LAPTOPS				varchar(50)
);




SELECT '2012-01-01', 0, 0, 1, client_id, upper(trim(PC))
FROM imp_assets
WHERE length(trim(PC)) > 0;

SELECT '2012-01-01', 0, 0, 2, client_id, upper(trim(MONITOR))
FROM imp_assets
WHERE length(trim(MONITOR)) > 0;

SELECT '2012-01-01', 0, 0, 3, client_id, upper(trim(LAPTOPS))
FROM imp_assets
WHERE length(trim(LAPTOPS)) > 0;

SELECT '2012-01-01', 0, 0, 4, client_id, upper(trim(ITN))
FROM imp_assets
WHERE length(trim(ITN)) > 0;

SELECT '2012-01-01', 0, 0, 5, client_id, upper(trim(LPRT))
FROM imp_assets
WHERE length(trim(LPRT)) > 0;

